import React, { Component } from 'react';
import Slider from './components/Slider';
import './App.scss';

class App extends Component {
  state = {
    show: false
  };
  showModal = e => {
    this.setState({
      show: !this.state.show
    });
  };

  render() {
    return (
      <Slider />
    );
  }
}

export default App;
